    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE 16 NOT BETWEEN + CAST ( NULL AS INTEGER ) * + col1 AND - col0 * + col2;
  - name: tab1

outputs:
  - name: q536.out
    data: |
      51	14	96
      85	5	59
      91	47	68
